import React from 'react'

const Header = (props) => {
  return(
    <>
    <h1>{props.course}</h1>
    </>
  )
}

const Content = () => {
  return (
    <>
    <Part part={App.part1.name} exercises={App.part1.exercises} />
    <Part part={App.part2.name} exercises={App.part2.exercises} />
    <Part part={App.part3.name} exercises={App.part3.exercises} />
    </>
  )
}

const Part = (props) => {
  return(
    <>
    <p>{props.part} {props.exercises}</p>
    </>
  )
}

const Total = (props) => {
  return(
    <>
    <p>Number of exercises {props.exercises1+props.exercises2+props.exercises3}</p>
    </>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course={course}/>
      <Content />
      <Total exercises1={part1.exercises} exercises2={part2.exercises} exercises3={part3.exercises}/>
    </div>
  )
}

export default App
